function section4counter(){const t=document.querySelectorAll(".counter-se4");t.forEach(t=>{const e=()=>{const n=+t.getAttribute("data-target"),o=+t.innerText,i=n/200;o<n?(t.innerText=Math.ceil(o+i),setTimeout(e,30)):o.innerText=n};e()})}$(document).ready(function(){AOS.init({disable:"mobile"})});const section4=document.getElementById("section4");window.addEventListener("scroll",function(){section4.getBoundingClientRect().top+145<window.innerHeight&&section4counter()});